public:
  pg_catalog:
    pg_stat_all_indexes:
      type: view
      view_sql: " SELECT c.oid AS relid,\n    i.oid AS indexrelid,\n    n.nspname\
        \ AS schemaname,\n    c.relname,\n    i.relname AS indexrelname,\n    pg_stat_get_numscans(i.oid)\
        \ AS idx_scan,\n    pg_stat_get_lastscan(i.oid) AS last_idx_scan,\n    pg_stat_get_tuples_returned(i.oid)\
        \ AS idx_tup_read,\n    pg_stat_get_tuples_fetched(i.oid) AS idx_tup_fetch\n\
        \   FROM pg_class c\n     JOIN pg_index x ON c.oid = x.indrelid\n     JOIN\
        \ pg_class i ON i.oid = x.indexrelid\n     LEFT JOIN pg_namespace n ON n.oid\
        \ = c.relnamespace\n  WHERE c.relkind = ANY (ARRAY['r'::\"char\", 't'::\"\
        char\", 'm'::\"char\"]);"
      schema:
        relid: int
        indexrelid: int
        schemaname: varchar(64)
        relname: varchar(64)
        indexrelname: varchar(64)
        idx_scan: bigint
        last_idx_scan: varchar(256)
        idx_tup_read: bigint
        idx_tup_fetch: bigint
      pg_types:
        relid: oid
        indexrelid: oid
        schemaname: name
        relname: name
        indexrelname: name
        idx_scan: int8
        last_idx_scan: timestamptz
        idx_tup_read: int8
        idx_tup_fetch: int8
